import Button from "react-bootstrap/Button";
import {Modal} from "react-bootstrap";

export function CloseModal(title, body) {
    return (
        <Modal.Dialog>
            <Modal.Header closeButton>
                <Modal.Title>{title}</Modal.Title>
            </Modal.Header>

            <Modal.Body>
                <p>{body}</p>
            </Modal.Body>

            <Modal.Footer>
                <Button variant="primary">Close</Button>
            </Modal.Footer>
        </Modal.Dialog>
    );
}
